$(document).ready(function() {
    //Navigation Toggle
    $(".navbar-toggle").on("click", function () {
        $(this).toggleClass("active");
    });

    //Uniform
    $('select, :checkbox, input[type="file"], :radio').not('.no-uniform').uniform({
        selectAutoWidth: false,
        selectClass:   '__selector',
        radioClass: '__radio',
        checkboxClass: '__checker',
        fileClass: '__uploader',
        checkedClass: 'checked',
        fileButtonHtml: 'Browse',
        fileDefaultHtml: 'Add a file'
    });

    $('input').click(function () {
        $('input:not(:checked)').parents('label').removeClass("_active");
        $('input:checked').parents('label').addClass("_active");
    });



    //Search Functions
    var s_t_v;
    $('.__trigger-search').click(function(event) {
        event.preventDefault();

        s_t_v = $(window).scrollTop();
        $('html, body').scrollTop(0);


        $('._primary-search').addClass('_display');
        $('.__quick-search').focus();    

        $('.__main-content').css({
            'height': '0',
            'overflow': 'hidden'
        }); 
    });

    $( ".__quick-search" ).focus(function(event) {
        $('.__search-overlay').show();
        $('._primary-search').addClass('_display');
        $('body').addClass('__search-focused'); 

        $('.__main-content').css({
            'height': '0',
            'overflow': 'hidden'
        });


        $('html, body').scrollTop(0);
    });

    $( ".__close-search" ).click(function(event) {
        event.preventDefault();

        $('.__search-overlay').hide();
        $('body').removeClass('__search-focused');
        $('._primary-search').removeClass('_display');
        $('.__quick-search').val('I want to...'); 
        $(window).trigger('scroll');

        $('.__main-content').css({
            'height': 'auto',
            'overflow': 'visible'
        });

        // $('html, body').animate({scrollTop: s_t_v }, 1200, 'swing');
        $('html, body').scrollTop(s_t_v);

        s_t_v = 0;
    });


    //Cart Functions
    $(".__trigger-cart").click(function(event) {
        event.stopPropagation();
        event.preventDefault();
        $("body").toggleClass("__cart-display");
        $(window).trigger('resize');
        $('.__quick-search').attr('disabled', 'disabled');
        $("._site-wrap").bind("click", function() {
            $(this).trigger("close_cart");
        });
    });

    $('._site-wrap').bind("close_cart", function(event){
        event.preventDefault();
        if($("body").hasClass('__cart-display')){
            $("body").removeClass("__cart-display");
            $('.__quick-search').removeAttr("disabled");
            $(this).unbind("click");
        }
    });

    $('.__close-cart').click(function(event){
        event.preventDefault();
        $("body").removeClass("__cart-display");
        $('.__quick-search').removeAttr("disabled");
    });


    //Header Links Opacity
    $('._primary-header ._navigation nav li').hover(function() {
        $(this).siblings().css('opacity', 0.5);
    }, function() {
        $(this).siblings().css('opacity', 1);
    });


    //Nano Scroller
    $(".nano").nanoScroller({ 
        iOSNativeScrolling: true,
        sliderMinHeight: 1,
        alwaysVisible: true
    });

    //Responsive Tables
    if($('.__responsive-table').length){
    $('.__responsive-table').ngResponsiveTables({
        smallPaddingCharNo: 13,
        mediumPaddingCharNo: 18,
        largePaddingCharNo: 30
    });
    }

    //Trigger Social Items
    if($('._home-social').length){
        $('._home-social').waypoint(function() {
            $('.__social-item-container').mixItUp({
                animation: {
                    animateChangeLayout: true,
                    animateResizeContainer: true
                }
            });
        },{ offset: $(window).height(), triggerOnce: true  });
    }
});
