$(function(){

	// dontation-process
	var ele_dp = {
		_  : $('.__donation-process'),
		overlay : $('._d-p-bg-overlay'),
		heading : $('._d-p-heading'),
		box1    : $('.__donation-process ._n-1'),
		box2    : $('.__donation-process ._n-2'),
		box3    : $('.__donation-process ._n-3'),
		txt 	: $('.__donation-process ._n-4')
	}

	var donationProcessAnimate = function(){

		new TweenLite.to(ele_dp.overlay, 0.25, 
			{opacity:".9"}
		);

		new TweenLite.fromTo(ele_dp.heading, 0.25, 
			{y: "20px"}, {opacity:"1", y: "0", delay:.25}
		);

		new TweenLite.fromTo(ele_dp.box1, 0.25, 
			{y: "20px"}, {opacity:"1", y: "0", delay:.5}
		);

		new TweenLite.fromTo(ele_dp.box2, 0.25, 
			{y: "20px"}, {opacity:"1", y: "0", delay:.75}
		);

		new TweenLite.fromTo(ele_dp.box3, 0.25, 
			{y: "20px"}, {opacity:"1", y: "0", delay:1}
		);

		new TweenLite.fromTo(ele_dp.txt, 0.25, 
			{y: "20px"}, {opacity:"1", y: "0", delay:1.5}
		);

	}
	
	if(ele_dp._.length){
		ele_dp._.waypoint(function() {
		    donationProcessAnimate();
		},{ offset: $(window).height()/2, triggerOnce: true  });
	}



	// water
	var ele_w = {
		_  : $('._project-gallery-grid'),
		item    : $('._gallery-item')
	}


	var s = 0;

	var projectGalleryAnimate = function(){
		
		ele_w.item.each(function() {
			new TweenLite.fromTo(this, 1, 
				{scale: "0.8", opacity: "0", y: "10"}, {scale:"1", opacity: "1", y:"0", delay: s * .18 }
			);
			s++;
		});

	}
	
	if(ele_w._.length){
		ele_w._.waypoint(function() {
		    projectGalleryAnimate();
		},{ offset: $(window).height()/2, triggerOnce: true  });
	}



	//Viewport Animations
	// var ele_vp = {
	// 	_  : $('.__vp-detect')
	// }

	// var viewPortAnimate = function(ele){

	// 	new TweenLite.fromTo(ele, 1.5, 
	// 		{y: "25", opacity: "0"}, {y:"0", opacity: "1"}
	// 	);

	// }
	
	// if(ele_vp._.length && (!$('html').hasClass('ie8'))){
	// 	ele_vp._.each(function(){
	// 		$(this).waypoint(function() {
	// 		    viewPortAnimate($(this));
	// 		},{ offset: ($(window).height() + 150), triggerOnce: true  });
	// 	});
	// }	




	// orphans-approach
	var ele_oa = {
		_  : $('.__orphans-approach'),
		overlay : $('._o-a-bg-overlay'),
		heading : $('._o-a-heading'),
		txt    : $('.__o-a-slider')
	}

	var orphansApproachAnimate = function(){

		new TweenLite.to(ele_oa.overlay, 1, 
			{opacity:".9"}
		);

		new TweenLite.fromTo(ele_oa.heading, 1, 
			{y: "20px"}, {opacity:"1", y: "0", delay:1}
		);

		new TweenLite.fromTo(ele_oa.txt, 1, 
			{y: "20px"}, {opacity:"1", y: "0", delay:1.5}
		);

	}
	
	if(ele_oa._.length){
		ele_oa._.waypoint(function() {
		    orphansApproachAnimate();
		},{ offset: $(window).height()/2, triggerOnce: true  });
	}



	

});


$(window).resize(function() {
	// Timeline
	if($(window).width() > 1023){
		var ele_tl = {
			_			: $('.__i-t-timeline'),
			circle		: '._circle',
			box 		: $('._i-t-timeline-block'),
			boxContent 	: '._content'
		}
		
		if(ele_tl._.length){
			ele_tl.box.each(function() {
				$(this).waypoint(function() {

					new TweenLite.fromTo($(this).find(ele_tl.circle), .3, 
						{scale: ".5"}, {opacity:"1", scale: "1.2", onComplete:function(){ 
							new TweenLite.fromTo(this.target, .3, 
								{scale: "1.2"}, {scale:"1"}
							);
						}}
					);

					if($(this).hasClass('_i-t-b-left')){

						new TweenLite.fromTo($(this).find(ele_tl.boxContent), .3, 
							{x: "-100px"}, {x:"20px", opacity: "1", onComplete:function(){ 
								new TweenLite.fromTo(this.target, .3, 
									{x: "20px"}, {x:"0"}
								);
							}
						}
						);

					} else {

						new TweenLite.fromTo($(this).find(ele_tl.boxContent), .5, 
							{x: "100px"}, {x:"-20px", opacity: "1", onComplete:function(){ 
								new TweenLite.fromTo(this.target, .3, 
									{x: "-20px"}, {x:"0"}
								);
							}
						}
						);

					}


				},{ offset: $(window).height() - 250, triggerOnce: true  });
			});
		}
	}	
}).trigger("resize");
