$(function() { 

    if(!$('html').is('.ipad, .ie8, .ie9, .ie10')){
        var Page = (function() {

            var $nav = $( '#nav-dots > span' ), $navArrows = $( '#nav-arrows' ),
                slitslider = $( '#slider' ).slitslider( {
                    onBeforeChange : function( slide, pos ) {
                        $nav.removeClass( 'nav-dot-current' );
                        $nav.eq( pos ).addClass( 'nav-dot-current' );
                    }
                } ),

                init = function() {

                    initEvents();
                    
                },
                initEvents = function() {

                // add navigation events
                $navArrows.children( ':last' ).on( 'click', function() {

                    slitslider.next();
                    return false;

                } );

                $navArrows.children( ':first' ).on( 'click', function() {
                    
                    slitslider.previous();
                    return false;

                } );


                    $nav.each( function( i ) {
                    
                        $( this ).on( 'click', function( event ) {
                            
                            var $dot = $( this );
                            
                            if( !slitslider.isActive() ) {

                                $nav.removeClass( 'nav-dot-current' );
                                $dot.addClass( 'nav-dot-current' );
                            
                            }

                            slitslider.jump( i + 1 );
                            return false;

                        
                        } );
                        
                    } );

                };

                return { init : init };
        })();

        Page.init();
    } else {
        $('.sl-slider').slick({
            dots: false,
            arrows: false,
            infinite: true,
            slidesToShow: 1,
            autoplay: false,
            slidesToShow: 1,
            slidesToScroll: 1
        });

        $('.sl-slider').on('beforeChange', function(event, slick, currentSlide, nextSlide){
            $('#nav-dots span').removeClass('nav-dot-current');
            $('#nav-dots span').eq(nextSlide).addClass('nav-dot-current');
        });

        $('.nav-arrow-prev').click(function(event) {
            $('.sl-slider').slick('slickPrev');
        });

        $('.nav-arrow-next').click(function(event) {
            $('.sl-slider').slick('slickNext');
        });
    
        $('#nav-dots span').each( function( i ) {
            $(this).click(function(){
                $('#nav-dots span').removeClass('nav-dot-current');
                $('.sl-slider').slick('slickGoTo', parseInt(i));
                $(this).addClass('nav-dot-current');
            })
        })   
    } 

});
