function RenderMustacheTemplate(template, model, dictionary) {
	if (dictionary !== null)
		model.dictionary = dictionary;

	model.translate = function () {
		return function (text, render) {
            if (model.dictionary === undefined) {
                return text;
            }

            var translation = model.dictionary[text];

            if (!translation) {
                return text;
            }

			return translation;
		}
	};

	return Mustache.render(template, model);
}


