//Img Retina
//automatically add @2x to images
var window_w = $(window).width();
$(window).resize(function(event) {
    var window_w = $(window).width();
    var images = $('.__retina-img');    

    if(!$('html').hasClass('ie8')){
        images.each(function(i) {
            if (window_w < 1024) {
                if(!$(this).hasClass('__img-retina-applied')){
                    var lowres = $(this).data('original-src') || $(this).attr('src');
                    var highres = $(this).data('retina-src') || lowres.replace(".", "@2x.");
                    $(this).attr('src', highres);
                    $(this).addClass('__img-retina-applied');
                }
            } else {
                if($(this).hasClass('__img-retina-applied')){
                    var lowres = $(this).data('original-src') || $(this).attr('src');
                    var highres = $(this).data('retina-src') || lowres.replace("@2x.", ".");
                    $(this).attr('src', highres);
                    $(this).removeClass('__img-retina-applied');
                }
            }
        });
    }

}).trigger('resize');



