// Gallery & Slick Sliders
function Slickify() {
    if($(".__gallery").length){
        var _gallery_slides = 4;

        $(".__gallery").each(function(i) {
            
            var el = $(this), 
                pr = el.find(".__primary").not(".slick-initialized"), 
                th = el.find(".__thumbs").not(".slick-initialized"), 
                activeClass="slick-active-item",
                p_h_h = $('._primary-header').height(), w_h = $(window).height(), popup = el.parents('.modal-dialog');

            if (popup.length) p_h_h = 0; //This is a popup.

            if (el.hasClass("__full-width-gallery")) {
                _gallery_slides = 10;

                if(el.find(th).length) {
                    $(window).resize(function(event) {
                        pr.css("height", (w_h - p_h_h - 100));
                    }).trigger('resize');
                } else {
                    $(window).resize(function(event) {
                        pr.css("height", (w_h - p_h_h));
                    }).trigger('resize');
                }
            }

            pr.on('init', function(event, slick){
                th.find("div").eq(0).addClass(activeClass);
            });

            
            if(el.parents().find('.__thumbs').length) {
                pr.slick({
                    slidesToShow: 1,
                    slidesToScroll: 1,
                    asNavFor: th,
                    infinite: true,
                    adaptiveHeight: true
                });
            } else {
                pr.slick({
                    slidesToShow: 1,
                    slidesToScroll: 1,
                    infinite: true,
                    adaptiveHeight: true
                });
            }

            th.slick({
                slidesToShow: _gallery_slides,
                slidesToScroll: 1,
                // centerMode: true,
                asNavFor: pr,
                focusOnSelect: true,
                arrows: true,
                infinite: true,
                responsive: [
                    {
                        breakpoint: 768,
                        settings: {
                            slidesToShow: 5
                        }
                    },
                ]
            });

            pr.on('afterChange', function(event, slick, currentSlide){
                th.find('.slick-slide').removeClass(activeClass);
                th.find('.slick-slide').not('.slick-cloned').eq(currentSlide).addClass(activeClass);
            });
        });
    }
    
    //GLOBAL SLICK SLIDERS
    if ($(".__slick-slider").length) {
        $(".__slick-slider").not(".slick-initialized").each(function(i) {
            var _prop=eval("({"+$(this).attr("rel")+"})");
            switch (_prop.responsiveMethod) {
                case '54321':
                    _prop.responsive =  [
                        {breakpoint: 1280, settings: {slidesToShow: 4, slidesToScroll: 1}},
                        {breakpoint: 1024, settings: {slidesToShow: 3, slidesToScroll: 1}},
                        {breakpoint: 1000, settings: {slidesToShow: 2, slidesToScroll: 1}},
                        {breakpoint: 768,  settings: {slidesToShow: 1, slidesToScroll: 1}} 
                    ]
                break;
                case '4321':
                    _prop.responsive =  [
                        {breakpoint: 1024, settings: {slidesToShow: 3, slidesToScroll: 3}},
                        {breakpoint: 1000, settings: {slidesToShow: 2, slidesToScroll: 2}},
                        {breakpoint: 768,  settings: {slidesToShow: 1, slidesToScroll: 1}} 
                    ]
                break;
                case '321':
                    _prop.responsive =  [
                        {breakpoint: 1024, settings: {slidesToShow: 2, slidesToScroll: 2}},
                        {breakpoint: 1000, settings: {slidesToShow: 1, slidesToScroll: 1}}
                    ]
                break;
                case '21':
                    _prop.responsive =  [
                        {breakpoint: 768, settings: {slidesToShow: 1, slidesToScroll: 1}}
                    ]
                break;
                case 'tc':
                    _prop.responsive =  [
                        {breakpoint: 1500, settings: {slidesToShow: 2, slidesToScroll: 2}},
                        {breakpoint: 1439, settings: {slidesToShow: 1, slidesToScroll: 1}}
                    ]
                break;
                default:
                break;
            }
            $(this).slick(_prop);
        });
    }

}; Slickify();

