$(".__countdown-timer").each(function() {
	var $this = $(this);

	var target_date = new Date($this.data("year"), $this.data("month"), $this.data("day"), $this.data("hour"), $this.data("minute"), 0, 0);

	// variables for time units
	var days, hours, minutes, seconds;

	// update the tag with id "countdown" every 1 second
	setInterval(function () {
		// find the amount of "seconds" between now and target
		var current_date = new Date().getTime();
		var seconds_left = (target_date - current_date) / 1000;

		// do some time calculations
		days = parseInt(seconds_left / 86400);
		seconds_left = seconds_left % 86400;

		hours = parseInt(seconds_left / 3600);
		hours = String(hours).length >= 2 ? hours : "0" + hours;
		seconds_left = seconds_left % 3600;

		minutes = parseInt(seconds_left / 60);
		minutes = String(minutes).length >= 2 ? minutes : "0" + minutes;
		seconds = parseInt(seconds_left % 60);

		var cssPrefix = "";
		if ($this.hasClass("_e-b-ticks")) {
		    cssPrefix = "_e-b";
		} else if ($this.hasClass("_hrc-ticks")) {
		    cssPrefix = "_hrc";
		}

		$this.html('<span class="' + cssPrefix + '-day">' + days + '</span>:<span class="' + cssPrefix + '-hour">' + hours + '</span>:<span class="' + cssPrefix + '-mins">' + minutes + '</span>');
		
		$this.show();
	}, 500);
});


